#include <stdio.h>
#include <stdlib.h>
#include <string.h>

long long beautifulSubstrings(char* s, int k) {
    long long ans = 0;
    int len = strlen(s);
    for (int start = 0; start < len; ++start) {
        int vowel = 0, consonant = 0;
        for (int end = start; end < len; ++end) {
            char c = s[end];
            if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') vowel++;
            else consonant++;
            if (vowel == consonant && (vowel * consonant) % k == 0) ans++;
        }
    }
    return ans;
}
